@app.callback(dash.dependencies.Output("bar", "figure"),
            [dash.dependencies.Input("cluster_selector", 'value')])

def update_bar(value):
    data_bar = data[data['0'] == int(value or 0)][['Player', 'Market value', 'Team', 'Position']]

    barchart_data = [go.Bar(x=data_bar['Player'], y=data_bar['Market value'], marker_color=data_bar['Market value'])]

    barchart_layout = go.Layout(paper_bgcolor='rgb(255,255,255)',
                                plot_bgcolor='rgb(255,255,255)', hovermode="closest",
                                font={"family": "Raleway", "size": 15}, height=600,title='Distribution of transfer values within cluster')

    return{
        'data': barchart_data,
        'layout': barchart_layout
    }



