@app.callback(dash.dependencies.Output("comparison", "figure"),
                [dash.dependencies.Input("player1", 'value'),
                dash.dependencies.Input("player2", 'value')])

def update_compare(player1, player2):

    compare_index_data = [go.Indicator(mode='number',
    value=round(scipy.spatial.distance.euclidean(distscalc[player1], distscalc[player2]), 3))]

    compare_index_layout = go.Layout(height=225, width=225, margin=dict(l=40, r=0, t=0, b=0))


    return{
        'data': compare_index_data,
        'layout': compare_index_layout
    }




@app.callback(dash.dependencies.Output("clusterbar", "figure"),
                [dash.dependencies.Input("gmm_cluster_selector", 'value'),
                dash.dependencies.Input("feature_selector", 'value')])

def update_clusterbar(gmm_cluster, feature):

    chosen_cluster = clusters2[clusters2['GMM_Cluster'] == gmm_cluster]

    clusterdata = [go.Scatter(x=chosen_cluster['Player'], y=chosen_cluster[feature],
                              marker_colorscale=plotly.colors.sequential.Magma,
                              marker_color=chosen_cluster[feature], mode='markers', marker=dict(size=16))]

    cluster_layout = go.Layout(paper_bgcolor='rgb(255,255,255)',
                               plot_bgcolor='rgb(255,255,255)', hovermode="closest",
                               font={"family": "Raleway", "size": 15}, height=600,
                               title='Distribution of selected feature within selected cluster')

    return{
        'data': clusterdata,
        'layout': cluster_layout
    }


